B.WL=new A.bO("The skin\u2019s design is based on ClockWorld. As a designer, I want to keep a specific style that characterizes my work and makes it recognizable among other creators. Thus, I chose to keep the most prominent design choices present in ClockWorld and give them  slight twist, making something different from the same successful base. Overall, Sparse\u2019s design is very straightforward with two widgets, one on top the top and another on the bottom of the screen, coming down to information hierarchy and visual balance. The time, date and weather widgets are grouped together transforming that part of he desktop to a status center that displays basic information about everyday things. On the other hand, the music player on the bottom of the screen works as a simple indicator of the current playing song, while giving an artistic style to the desktop. All in all, the skin\u2019s design is focused on keeping things as hassle-free as possible by including the basic information anyone would need during their time using their devices. ",null,null,B.G,null,null,null)
B.WM=new A.bO("The Settings menu is heavily inspired by he windows 10 Fluent design system which was a successful story when it came out. The design is simple and is focused on usability without compromising on design familiarity, creating a user friendly design. The view window is split into two parts, the settings categories and the settings options. Its way of usage is really simple as users are already accustomed with this type of design from their operating system.\n\nEvery skin has very similar style of Settings menu. This is done in order to effectively manage adaptability and scalability for the long term. Despite that, every skin has its own special settings and thus the Settings  changes its content but with keeping the overall design parameters the same.",null,null,B.G,null,null,null)
B.dd=new A.t(!0,null,null,null,null,null,16,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.WN=new A.bO('Motions graphics presenting the channel\'s program for the "Old" movie in Alpha Greek channel.',null,B.dd,null,null,null,null)
B.WO=new A.bO('The design is based on the widely used motion graphics design for "Upcoming" content on TV channels around the world. I tried to use this approach to the conventional channel program video by adding some more eye-catching visual effects and improving its importance on the screen. What is more, the smooth transitions as well as the position of the graphics catch the attention of the watcher and ensure a readable and familiar experience.',null,B.dd,null,null,null,null)
B.TX=new A.t(!0,null,null,null,null,null,35,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.WP=new A.bO("The approach",null,B.TX,null,null,null,null)
B.WR=new A.bO("ERT1 Greek TV channel Blockbuster Series advertisement.",null,B.dd,null,null,null,null)
B.WS=new A.bO("The skin\u2019s design is focused on simplicity with some bits of character, like the slight gradient color in the time. It\u2019s focused on being more practical than decorative, with clear information organized in a very distinct way.\n\nMeenimal\u2019s layout is inspired by the mobile design world where the status information is grouped together. Lines divide the information and the size plays the role of hierarchy. The time and date are the most prominent while otherI secondary elements are smaller and grouped together. Finally, a nice touch of a quote that changes every few minutes adds a emotional touch to the skin and creates a pleasant working environment.",null,null,B.G,null,null,null)
B.WU=new A.bO("Ellinikon Vintage and Ellinikon Seaside typically operate independently but occasionally both are open simultaneously. The identity of Ellinikon Vintage is characterized by bold colors, strong typography, and vintage imagery. In contrast, Ellinikon Seaside emphasizes glamour and vibrant colors. Both entities share a common principle: events are communicated with a prominent, logo-like title, followed by additional information presented with lower hierarchy.",null,null,null,null,null,null)
B.Tj=new A.t(!0,null,null,null,null,null,30,B.bj,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.WV=new A.bO("Got lost in all these projects?",null,B.Tj,B.af,null,null,null)
B.WW=new A.bO("views",null,null,null,null,null,null)
B.WX=new A.bO("The settings menu is the best example of a good user experience in every application. In clockworld, it enables the customization of the skin in various ways, split into categories. it manages to display a big amount of information organized in a very convenient way. Just like that, clockworld settings menu features consistency along with sleek and user friendly environment despite rainmeter\u2019s restrictions. By using packages created by the community and with the advice of its people, this interface came to life and it\u2019s praised as one of he best Rainmeter settings menus out there.",null,null,B.G,null,null,null)
